<!DOCTYPE html>
<html>
<head>
  <meta charset="utf-8">
  <link rel="stylesheet" href="css/popup.css" type="text/css" media="all">
  <link rel="stylesheet" href="css/kickstart.css" type="text/css" media="all">
  <link rel="stylesheet" href="font-awesome/css/font-awesome.min.css" type="text/css" media="all">
  <link rel="stylesheet" href="css/no-theme/jquery-ui-1.10.3.custom.min.css" type="text/css" media="all">
  <title>Dial Bookmarks</title>
</head>
<body>
  <div class="popup bookmarks">
    <div class="result_outer bookmks">
      <i class="fa fa-times"></i>
      <div class="resizeR"></div>
    </div>
    <div class="result_outer folders">
      <i class="fa fa-times"></i>
      <form>
        <button type="submit" tabindex="-1"><i class="fa fa-search"></i></button><input type="text" class="query" size="15">
      </form>
      <div class="scrollEnd">
    </div>
  </div>
  <div class="resizeX"></div>
  <div class="resizeY"></div>
  <script src="popup.js"></script>
  <div class="dragMoving"></div>
  <div class="popupSubmenu"></div>
</body>
</html>
